import * as React from "react";
import { styled, alpha } from "@mui/material/styles";
import {
    AppBar,
    Box,
    Toolbar,
    Typography,
    InputBase,
    IconButton,
    Paper,
    Fab,
    Button,
    Dialog,
    DialogTitle,
    DialogContent,
    DialogActions,
    TextField,
} from "@mui/material";
import TextareaAutosize from "@mui/base/TextareaAutosize";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Menu";
import SearchIcon from "@mui/icons-material/Search";
import EditIcon from "@mui/icons-material/Edit";
import AddIcon from "@mui/icons-material/Add";
import { ThemeProvider, createTheme } from "@mui/material/styles";

const darkTheme = createTheme({
    palette: {
        mode: "dark",
    },
});

const Search = styled("div")(({ theme }) => ({
    position: "relative",
    borderRadius: theme.shape.borderRadius,
    backgroundColor: alpha(theme.palette.common.white, 0.15),
    "&:hover": {
        backgroundColor: alpha(theme.palette.common.white, 0.25),
    },
    marginLeft: 0,
    width: "100%",
    [theme.breakpoints.up("sm")]: {
        marginLeft: theme.spacing(1),
        width: "auto",
    },
}));

const SearchIconWrapper = styled("div")(({ theme }) => ({
    padding: theme.spacing(0, 2),
    height: "100%",
    position: "absolute",
    pointerEvents: "none",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
    color: "inherit",
    "& .MuiInputBase-input": {
        padding: theme.spacing(1, 1, 1, 0),
        // vertical padding + font size from searchIcon
        paddingLeft: `calc(1em + ${theme.spacing(4)})`,
        transition: theme.transitions.create("width"),
        width: "100%",
        [theme.breakpoints.up("sm")]: {
            width: "12ch",
            "&:focus": {
                width: "20ch",
            },
        },
    },
}));

export interface DialogTitleProps {
    id: string;
    children?: React.ReactNode;
    onClose: () => void;
}

function BootstrapDialogTitle(props: DialogTitleProps) {
    const { children, onClose, ...other } = props;

    return (
        <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
            {children}
            {onClose ? (
                <IconButton
                    aria-label="close"
                    onClick={onClose}
                    sx={{
                        position: "absolute",
                        right: 8,
                        top: 8,
                        color: (theme) => theme.palette.grey[500],
                    }}
                >
                    <CloseIcon />
                </IconButton>
            ) : null}
        </DialogTitle>
    );
}

export default function Home() {
    const [title, setTitle] = React.useState("");

    const BootstrapDialog = styled(Dialog)(({ theme }) => ({
        "& .MuiDialogContent-root": {
            padding: theme.spacing(2),
        },
        "& .MuiDialogActions-root": {
            padding: theme.spacing(1),
        },
    }));

    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
    };
    const handleClose = () => {
        setOpen(false);
    };

    let rows = 1;
    const handleAddPage = () => {
        if (rows > 19) return;
        rows++;

        const newPage = document.getElementById("A").innerHTML;

        document.getElementById("Page").innerHTML += newPage;
    };

    const handleTitleChange = (e) => {
        setTitle(e.target.value);
    };
    return (
        <ThemeProvider theme={darkTheme}>
            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static">
                    <Toolbar>
                        <IconButton
                            size="large"
                            edge="start"
                            color="inherit"
                            aria-label="open drawer"
                            sx={{ mr: 2 }}
                        >
                            <MenuIcon />
                        </IconButton>
                        <Typography
                            variant="h6"
                            noWrap
                            component="div"
                            sx={{
                                flexGrow: 1,
                                display: { xs: "none", sm: "block" },
                            }}
                        >
                            Pages
                        </Typography>
                        <Search>
                            <SearchIconWrapper>
                                <SearchIcon />
                            </SearchIconWrapper>
                            <StyledInputBase
                                placeholder="Search…"
                                inputProps={{ "aria-label": "search" }}
                            />
                        </Search>
                    </Toolbar>
                </AppBar>
            </Box>{" "}
            <div>
                <div id="AddPages">
                    <Fab
                        color="primary"
                        aria-label="add"
                        id="AddPage"
                        onClick={() => handleClickOpen()}
                    >
                        <AddIcon />
                    </Fab>
                    <BootstrapDialog
                        onClose={handleClose}
                        aria-labelledby="customized-dialog-title"
                        open={open}
                    >
                        <BootstrapDialogTitle
                            id="customized-dialog-title"
                            onClose={handleClose}
                        >
                            Compose
                        </BootstrapDialogTitle>
                        <DialogContent dividers id="dialog">
                            <TextField
                                variant="standard"
                                className="space-between"
                                value={title}
                                onChange={handleTitleChange}
                                inputProps={{
                                    style: {
                                        fontSize: 18,
                                        textAlign: "center",
                                        textTransform: "capitalize",
                                    },
                                }}
                                fullWidth
                            ></TextField>
                            <textarea disabled={!title.length > 0} />
                        </DialogContent>
                        <DialogActions>
                            <Button autoFocus onClick={handleClose}>
                                Save changes
                            </Button>
                        </DialogActions>
                    </BootstrapDialog>
                </div>
            </div>
            <div id="A" style={{ display: "none" }}>
                <div id="As">
                    <Paper sx={{ maxWidth: 300, minHeight: 200, marginTop: -8 }}>
                        <div className="buttons">
                            <Fab color="primary" aria-label="add">
                                <EditIcon />
                            </Fab>
                        </div>
                    </Paper>
                </div>
            </div>
            <div className="Pages" id="Page">
                <div id="As">
                    <Paper sx={{ maxWidth: 300, minHeight: 200, marginTop: -8 }}>
                        <div className="buttons">
                            <Fab color="primary" aria-label="add">
                                <EditIcon />
                            </Fab>
                        </div>
                    </Paper>
                </div>
            </div>
        </ThemeProvider>
    );
}
